.
After a lunch with my Mentor Mel Donohoe descussing her latest big project exploring ephemeral experience.
We see an old storage locker be cleared out. I was inspired both by Mels work at the time and her words about who the man's whole life had been reduced to a skip... How curious it is to see a life time of moments
But no memories
.
I began to collect sort and Exsperiment with as meny objects as I could salvage from the skip.
Exploring the ideas as old as man himself... What will we leave behind?
How will people remenber our lives?
.
